import './AddPost.css';

const AddPost = () => {
    return (
        <div id="form-wrapper">
            <form id="add-form">
                <input name="title"></input><br/>
                <h2>Add description</h2>
                <textarea placeholder="Add your description here"></textarea><br/>

                <input name="price"/><br/>
                <input type="submit"/>
            </form>
        </div>
    );
}

export default AddPost;
